Nederland
Drama / Roadmovie
90 minuten

geregisseerd door Dana Nechushtan
met Maryam Hassouni, Eva van de Wijdeven en Theo Maassen

Dunya is Marokkaans, opgegroeid met ramadan, imams en Mekka. Desie is zo Hollands als kaas en tulpen. De vriendinnen zijn inmiddels 18; tijd voor het echte leven. Op haar verjaardag krijgt Dunya van haar ouders te horen dat ze wordt uitgehuwelijkt aan een Marokkaanse neef. Daar heeft ze weinig trek in. Desie raakt zwanger van haar rijschoolleraar die haar in de steek laat. Desie weet niet of ze het kindje wil houden. Ze besluit op zoek te gaan naar haar eigen biologische vader. Als blijkt dat die in Marokko woont, biedt dit een vluchtmogelijkheid voor beide vriendinnen en gaan ze samen naar hem op zoek. Maar Marokko is geen Amsterdam Noord en ze komen in allerlei spannende en ook grappige situaties terecht. Uiteindelijk komen ze voor een aantal belangrijke keuzes te staan.


